var fn = {

  /**
   * Generate url with http query
   * 
   * @param  string   url    
   * @param  object   params 
   * @return string
   */
  url: (function() {
    var url = function(url, params) {
      var url = fn.url.base + url;
      
      // Basic
      if (_.isNil(params)) {
        return url;
      }
      // URL join
      else if (_.isArray(params)) {
        return url + "/" + params.join("/");
      }
      // Http Query Builder
      else {
        var query = [];
    
        for (var key in params) {
          query.push(key + '=' + encodeURIComponent(params[key]));
        }
    
        return url + '?' + query.join("&");
      }
    };

    url.base = "";

    return url;
  }) (),

  format: {
    /**
     * Convert value into number format
     * 
     * @param  String|int  value
     * @param  String  comma         jumlah digit angka dibelakang comma
     * @param  String  thousand_sep  default: "."
     * @param  String  dec_point     default: ","
     * @return String
     */
    num: function(value, comma, thousand_sep, dec_point) {
      // remove unwanted characters
      var value = String(value).replace(/[^\d\-]/gi, '');

      var comma = comma || 0,
        strval = String(value<0 ? value*-1 : value).replace(/[\s\,\.\-]/g, ''),
        len = strval.length-comma;

      var str = "";
      var start = 0;
      var c = Math.ceil(len/3);

      var thousand_sep = thousand_sep || ".";
      var dec_point = dec_point || ",";
      var mod = len%3;
      mod = mod==0 ? 3 : mod;

      // reformat value
      for (var i = 0; i < c; i++) {
        str += strval.substr(start,i==0 ? mod : 3);
        str += i+1==c ? comma!=0 ? dec_point : '' : thousand_sep;
        start += i==0 ? mod : 3;
      }

      str += strval.substr(len, comma);

      // negative value
      if (value<0) 
        str = '-'+str;

      return str;
    }
  },

  /**
   * Check if variable is empty
   * 
   * @param  mixed  object
   * @return boolean
   */
  empty: function(object) {
    var type = typeof object;

    switch (type) {
      case "undefined":
        return true;

      case "object":
        if (object === null)
          return true;

        return object.hasOwnProperty('length') ? object.length==0 : Object.keys(object).length==0;

      case "string":
        return object.trim()==="";

      default: return false;
    }
  },

  /**
   * Check variable existence
   * 
   * @param  mixed  value
   * @return boolean
   */
  isset: function(value) {
    if (value === undefined || value === null)
      return false;

    for (var i in arguments) {
      if (i == 0)
        continue;

      if (typeof value[arguments[i]] === "undefined")
        return false;

      value = value[arguments[i]];
    }

    return true;
  },

  /**
   * Show messages notification
   * @param  String|Array messages
   * @param  String type
   */
  notif: (function() {
    var notif = function(messages, type) {
      if (!(messages instanceof Array))
        messages = [messages];

      for (var i in messages)
        notif.add(messages[i], type);
    };

    notif.add = function(message, type) {
      var param = typeof message!=="object" ? {msg: message} : message;

      if (!window.stack_bottomright) {
        window.stack_bottomright = {"dir1": "up", "dir2": "left", "firstpos1": 15, "firstpos2": 15};
      }

      // set class name
      param.type = type || param.type || "notice";
      param.class = param.class || "";

      switch (param.type) {
        case "info": 
          param.title = param.title || "Information";
          param.icon = param.icon || "fa fa-info";
          break;

        case "error": 
          param.title = param.title || "Ooopss..!";
          param.icon = param.icon || "fa fa-times";
          break;

        case "success": 
          param.title = param.title || "Successful";
          param.icon = param.icon || "fa fa-check";
          break;

        case "warning": 
          param.type = "notice";
        case "notice": 
        default: 
          param.title = param.title || "Warning";
          param.icon = param.icon || "fa fa-exclamation-triangle";
          break;
      };

      var notice = new PNotify({
        title: param.title,
        text: param.msg,
        type: param.type,
        addclass:  param.class +' stack-bottomright',
        icon: param.icon,
        shadow: true,
        buttons: {closer: false, sticker: false},
        stack: stack_bottomright,
      });

      // remove notification on click
      notice.get().click(function() {
        notice.remove();
      });
    };

    return notif;
  }) (),
};
fn.csrf = $('meta[name="csrf-token"]').attr("content");

/**
 * Get value from array/object by key location (e.g: path.to.value)
 * 
 * @param  array|object  data
 * @param  String  index  
 */
fn.get = function(data, index) {
    // data should be array or obejct
    if (data === undefined || data === null)
        return;

    var indexes = new String(index).split(".");
    var tmp = $.extend(true, {}, data);

    for (var i in indexes) {
        // trying to retrieve undefined index
        if (typeof tmp[indexes[i]] === "undefined")
            return;

        tmp = tmp[indexes[i]];
    }

    return tmp;
};
/**
 * Show error modal
 * 
 * @param  String  message
 * @param  String  title  
 */
fn.alertError = function(message, title) {
    var modal = $("#error-alert");

    modal.modal("show");

    if (title !== undefined)
        $(".modal-title", modal).html(title);

    if (message !== undefined)
        $(".modal-body", modal).html(message);
}

/**
 * Show alert Modal
 * 
 * @param  String  message
 * @param  String  title  
 */
fn.alert = function(message, title) {
    var modal = $("#modal-basic");

    modal.modal("show");

    $(".modal-title", modal).html(title || "Info");

    if (typeof message !== 'string') {
        var msg = "";

        for (var i in message)
            msg += "<li>"+ message[i] +"</li>"

        $(".modal-body", modal).html(msg);
    }
    else $(".modal-body", modal).html(message);
}

/**
 * Show Confirmation Modal
 * 
 * @param  object  opt
 */
fn.confirm = function(opt) {
    var modal = $(opt.selector || "#modal-confirm");

    // show modal event
    if (!modal.hasClass("in")) {
        modal.find(".modal-title").html(opt.title || "Warning!");
        modal.find(".modal-body").html(opt.body || "Are you Sure ?");
        modal.modal("show");

        var accept = false;

        // yes
        modal.find('.modal-accept').unbind("click").bind("click", function(e) {
            accept = true;

            if (opt.hasOwnProperty("yes"))
                opt.yes(e);
        });

        // no
        modal.off("hidden.bs.modal").on("hidden.bs.modal", function(e) {
            if (accept===false && opt.hasOwnProperty("no"))
                opt.no(e)
        })
    }

    return modal;
}

/**
 * show flash messages alert
 * @param  String|Array messages
 * @param  String type
 */
fn.flash = function(messages, type) {
    if (!(messages instanceof Array))
        messages = [messages];

    $("<div class='alert alert-"+ (type || "warning") +"' role='alert'>"
            +"<button type='button' class='close' data-dismiss='alert'> <span>&times;</span> </button>"
            +"<li>"+ messages.join("</li><li>") +"</li>"
        +"</div>"
    ).hide().insertAfter(".page-header").fadeIn();
}
fn.event = {
  funcs: {__tmp: []},

  push: function(name, callback) {
    // temporary events
    if (typeof arguments[0] === "function") {
      var name = "__tmp";
      var callback = arguments[0];
    }

    if (typeof callback === "function") {
      // append callback if array
      if (_.isArray(this.funcs[name])) {
        this.funcs[name].push(callback);
      }
      else this.funcs[name] = callback;
    }
  },

  trigger: function(name, scope) {
    var scope = scope || document;

    // trigger event by name
    if (fn.event.exists(name)) {
      return this.funcs[name](scope);
    }
    // trigger all
    else if (name === "*") {
      for (var name in this.funcs) {
        // skip __tmp
        if (name !== "__tmp") {
          this.funcs[name](scope)
        }
      }
    }
    // trigger temporary
    else {
      for (var i in this.funcs.__tmp) {
        this.funcs.__tmp[i]()
      }

      // clear temporary
      this.funcs = [];
    }
  },

  exists: function(name) {
    return this.funcs.hasOwnProperty(name);
  },

  pull: function(name) {
    return this.funcs[name];
  },

  drop: function(name) {
    if (fn.event.exists(name)) {
      delete this.funcs[name];
    }
  },
}
